/**
* GeoService Module
* 
* This module provides services for managing geographical data, including retrieving locations,
* saving new geographical entries, updating existing entries, and deleting locations. It interacts 
* with the Location model and utilizes various utilities for error handling.
* 
* Functions:
* 
* 1. getLocations(nyxciphers)
*    - Retrieves a list of location IDs from the provided Nyxcipher objects.
*    - Returns an array of location IDs.
* 
* 2. getLocation(id)
*    - Retrieves a specific location by its ID.
*    - Throws NotFoundError if the location is not found.
*    - Returns the location.
* 
* 3. saveLocation(body)
*    - Saves a new geographical entry with the provided details.
*    - Returns the saved location.
* 
* 4. updateLocation(id, body)
*    - Updates an existing location identified by its ID with the provided details.
*    - Throws NotFoundError if the location is not found.
*    - Returns the updated location.
* 
* 5. deleteLocation(id)
*    - Deletes a location identified by its ID.
*    - Throws NotFoundError if the location is not found.
*    - Returns true if the deletion is successful.
* 
* Models:
* 
* - Location: Represents a geographical point or area in the system.
* 
* Errors:
* 
* - NotFoundError: Thrown when a requested resource is not found.
* - ValidationError: Thrown when validation of input data fails.
* - BadRequestError: Thrown when a bad request is made.
* 
* Example Usage:
* 
* const geoService = require('./geoService');
* 
* // Get locations
* geoService.getLocations(location)
*   .then(locations => console.log(locations))
*   .catch(err => console.error(err));
* 
* // Get a specific location
* geoService.getLocation(locationId)
*   .then(location => console.log(location))
*   .catch(err => console.error(err));
* 
* // Save a new location
* geoService.saveLocation(locationData)
*   .then(location => console.log(location))
*   .catch(err => console.error(err));
* 
* // Update a location
* geoService.updateLocation(locationId, updateData)
*   .then(updatedLocation => console.log(updatedLocation))
*   .catch(err => console.error(err));
* 
* // Delete a location
* geoService.deleteLocation(locationId)
*   .then(() => console.log('Location deleted'))
*   .catch(err => console.error(err));
*/ 

